using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.SceneManagement;

public class titleScript : MonoBehaviour
{
    float targetTime;
    bool cooldown;
    float titleTimer;
    // Start is called before the first frame update
    void Start()
    {
        titleTimer = 30.0f;
        if((SceneManager.GetActiveScene()).name.Equals("Credits"))
        { 
            targetTime = 3.0f;
        }
        else if((SceneManager.GetActiveScene()).name.Equals("Title")|| (SceneManager.GetActiveScene()).name.Equals("VTitle"))
        {
            targetTime = 2.0f;
        }
        cooldown = true;
    }


    // Update is called once per frame
    void Update()
    {
        //Scene changer
        BioTrack.OnStart((List<JoinRequestUser> users) =>
        {
            if(SceneManager.GetActiveScene().name.Equals("Title") || SceneManager.GetActiveScene().name.Equals("VTitle"))
            {
                SceneManager.LoadScene("MainGameplay");
            }
        });

        if (SceneManager.GetActiveScene().name.Equals("Title"))
        {
            titleTimer -= Time.deltaTime;
            if(titleTimer<= 0)
            {
                titleTimer = 30.0f;
                SceneManager.LoadScene("preview");
            }
        }
        //Credits
        
        
        
        
        
        
        if ((Input.GetKey(KeyCode.J)) && (((SceneManager.GetActiveScene()).name.Equals("Title")) || (SceneManager.GetActiveScene()).name.Equals("VTitle")) && !cooldown)
        {
            Debug.Log("Report to credits immediately");
            titleTimer = 30.0f;
            SceneManager.LoadScene("Credits");
        }
        else if (((Input.GetKey(KeyCode.J) && (SceneManager.GetActiveScene()).name.Equals("Credits")) && !cooldown) || Input.GetAxis("left") == 1)
        {
            Debug.Log("RETREAT!");
            SceneManager.LoadScene("Title");
        }


        if (cooldown)
        {
            targetTime -= Time.deltaTime;

            if (targetTime <= 0.0f)
            {
                timerEnded();
            }


        }
    }



    void timerEnded()
    {
        cooldown = !true;
        Debug.Log("Cooldown: " +cooldown);
    }
}
